import styles from './Favoritos.module.css';
import favoritosImage from './favoritos.png';
function Favoritos({img, color}) {
    return(
        <div className={styles.capa} style={{ backgroundImage: `url(${favoritosImage})` }}>
            <div className={styles.gradient} style={{ background: `${color}` }}>
            </div>
        </div>
    );
}

export default Favoritos;
